exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog");return parseCatalog(`https://www.woaidu.info/book/${bid}/`,{cleaner:html=>cleanCatalogWrapper(html,/id="readerlist"/,"</ul>"),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions)}})};